import {BiTrash} from "react-icons/bi";


const AppointmentInfo = (props ) => {

    return (
        <li className="px-3 py-3 flex items-start">
            <button onClick={ () => props.onDeleteAppointment(props.id)}
                type="button"
                    className="p-1.5 mr-1.5 mt-1 rounded text-white bg-red-500 hover:bg-yellow-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500">
                <BiTrash /></button>
            <div className="flex-grow">
                <div className="flex items-center">
                    <span className="flex-none font-medium text-2xl text-blue-500">{props.petName}</span>
                    <span className="flex-grow text-right">{props.aptDate}</span>
                </div>
                <div><b className="font-bold text-blue-500">Owner:</b>{props.ownerName}</div>
                <div className="leading-tight">{props.aptNotes}</div>
            </div>
        </li>
    )

}
export default AppointmentInfo
